		0346C9E31B46FADC00FD978D /* PBXBuildRule */ = {
			isa = PBXBuildRule;
			compilerSpec = com.apple.compilers.proxy.script;
			filePatterns = "*.capnp";
			fileType = pattern.proxy;
			isEditable = 1;
			outputFiles = (
				"$(DERIVED_FILE_DIR)/${INPUT_FILE_BASE}.capnp.cc",
				"$(DERIVED_FILE_DIR)/${INPUT_FILE_BASE}.capnp.h",
			);
			script = "cd ${INPUT_FILE_DIR}\n\n# Weird: it's necessary to pass the full path to -o.\n# It wasn't at first... '-oc++:${DERIVED_FILE_DIR}' originally worked fine.\n${CAPNP} compile -o${CAPNP_DIR}/bin/capnpc-c++:${DERIVED_FILE_DIR} ${INPUT_FILE_BASE}.capnp\n\n# Weird: if we try to \"mv\" the file it sometimes can't find it.\n# However, it's always there when we try to \"cp\" it.\n# BUT! It's not always there when we try to \"rm\" it, hence \"rm -f\"\n# so that it doesn't fail if the file doesn't exist.  :-/\ncd ${DERIVED_FILE_DIR}\ncp ${INPUT_FILE_BASE}.capnp.c++ ${INPUT_FILE_BASE}.capnp.cc\nrm -f ${INPUT_FILE_BASE}.capnp.c++";
		};
